import axios from "axios"

export const signupSuccess = data => {
    return {
        data: data,
        type: SIGNUP_SUCCESS
    };
};

export const signup = data => {
    return dispatch => {
        axios.post('/signup', data)
        .then( res => {
            console.log(res.data);
            dispatch(signupSuccess(res.data));
        })
        .catch( err => {
            console.log(err);
        });
    };
};
